import React from 'react'
import BusinessIcon from '@material-ui/icons/Business';
import HomeIcon from '@material-ui/icons/Home';
import styled from 'styled-components';
import SearchIcon from '@material-ui/icons/Search';
import {Avatar} from '@material-ui/core'
import ChatIcon from '@material-ui/icons/Chat';
import AddCircleSharpIcon from '@material-ui/icons/AddCircleSharp';
import { Link } from 'react-router-dom';
const Nav = styled.nav`
  display:flex;
  justify-content:space-between;
  padding:15px 20px;
  position:sticky;
  align-items:center;
  z-index:100;
  top:0px;
  box-shadow:0px 5px 8px -9px rgba(0,0,0,0.75) ;
`
const AddAnnoce = styled(AddCircleSharpIcon)`
  height:100%;
  ${'' /* width:100%; */}
  color:gray;
  cursor:pointer 

`
const NavContainer = styled.div`
  display:flex;
  position:relative;
  height:100%;
  width:100%;


`


const MLink = styled(Link)`
  display:flex;
  jusify-content:center;
  align-items:center;
  height:40px;
  width:70px;
  border-radius:50px;
  background-color:#eff2f5;
  margin-left:5px;
`
const SearchInfo = styled.div`
  display:flex;
  jusify-contet:center;
  align-items:center;
  background-color:#eff2f5;
  padding:10px;
  margin-left:10px;
  border-radius:999px;
`
const Search = styled.input`
    border:none;
    background-color:transparent;
    outline-width:0;  
`
const HomLogo = styled(HomeIcon)`
  color:gray;
  height:40px;
  margin-left:5px;
`
const Logo = styled(BusinessIcon)`
  display:flex;
  height:40px;
  width:40px;
  color:gray;
  padding-right:40px;
`
const Chat = styled(ChatIcon)`
  margin:0px 18px;
  color:gray;
`
const HeaderInfo = styled.div`
  display:flex;
  jusify-content:center;
  align-items:center;

`
const NavItems = styled.div`
  display:flex;
  flex:1;
  justify-content:center;
  align-items:center;
  padding:0px  40px;
  margin-left:40px;
  position:absolute;
  left:5rem;

`
const Avatared = styled(Avatar)`

`
const Header = () => {
  return (
    <>
      <Nav>
      <NavContainer>
       <Logo/>
        <SearchInfo>
          <SearchIcon />
          <Search/>
        </SearchInfo>
        <NavItems>
          <HomLogo />
          <MLink to='/home'>
            <AddAnnoce/>
          </MLink>
        </NavItems>

        <HeaderInfo>
          <Avatared />
          <Chat/>
        </HeaderInfo>
        </NavContainer>
        </Nav>
    </>
  )
}
export default Header
